import React,{Component} from "react";
class Header extends Component{
 render() {
        return (
            <div classname="header">
  <div classname="header-header">
    <img classname alt="Logo" src="./image/Logo.png" />
  </div>
  <div classname="search">
    <input classname="btn_search" type="submit" defaultvalue="OK" defaultValue="Tìm Kiếm" />
    <input classname="key_search" type="text" />
  </div>
</div>

           
        )
 }
}
export default Header;
